"Язык без границ" – бесплатное  аудио-приложение к книге «Карманный самоучитель. Итальянский язык».

С приложением "Язык без границ" вы научитесь естественному итальянскому произношению и сможете понимать речь носителей языка на слух.

Карманный самоучитель идеально подойдет тем, кто хочет попробовать учить итальянский, но еще не решается пойти на курсы или купить большой фундаментальный учебник. С "Карманным самоучителем" вы сможете заложить прочную основу изучения языка и познакомиться с итальянским языком и культурой. 

Если вы собираетесь в отпуск в Италию, примерно за месяц до поездки начните читать "Карманный самоучитель" – и, будучи за границей, вы будете себя чувствовать гораздо свободнее, сможете говорить простыми фразами и будете понимать, что вам отвечают.

Пользоваться приложением лучше всего в сочетании с книгой, в приложении доступна лишь небольшая часть содержания книги: фонетический курс, диалоги с переводом и задания на аудирование.

При установке приложения все аудиозаписи скачиваются на телефон или планшет и становятся доступны офлайн. Так что вы можете в любую свободную минуту в транспорте послушать диалог и вспомнить пройденный материал.

Приложение "Язык без границ» для изучения итальянского языка – это:

– самые необходимые темы для общения: 
Приветствие и знакомство; 
Путешествие (Транспорт); 
Проживание; 
Кафе и ресторан; 
Музеи, памятники и развлечения; 
Покупки; 
Телефон, интернет и почта; 
Здоровье и медицина; 
Банк и полиция.

– диалоги о том, как спросить дорогу, как сделать заказ в ресторане, как купить билет на поезд и т. д.;

– тренировка понимания устной речи и произношения;

– прослушивание диалога целиком и по репликам;

– просмотр текста каждой реплики с переводом на русский язык;

– задания на аудирование в конце каждой темы;

– результаты выполнения заданий в разделе "Статистика";

– примеры чтения слов в разделе "Фонетика".

