Уроки Английского от EnglishDom - это специально разработанные уроки английского по грамматике и разговорной речи для самостоятельного изучения языка.


В приложении ED Courses доступно:
► 4 базовых курса для изучения английского по уровням - от elementary до upper intermediate;
► 7 специализированных курсов - для IT-специалистов, бизнеса, подготовка к IELTS, подготовка к ЭГЕ, неправильные глаголы;
►200+ уроков английского языка по грамматике и разговорной речи в каждом курсе.

Каждый урок это:
► Словарь — это 4 типа упражнений на запоминание слов (выбор правильного перевода, аудирование, собрать слово из букв, напечатать слово в строке ввода). Для каждого слова мы подобрали картинку-ассоциацию, чтобы облегчить запоминание. Для заучивания слов используем умный алгоритм интервальных повторений, основанный на кривой забывания слов Эббингауза;
► Теория — видео ролики простые и понятные, даже начинающим, объяснения правил английского языка. Примеры дублируются текстом и звуком;
► Практика — это письменные упражнения для закрепления изученного, несколько типов упражнений для лучшего закрепления всех нюансов правил;
► Life story — это задания для развития навыков аудирования/чтения на примерах живого контента. До 30% новой лексики в каждом тексте;
► Разговорник — это упражнение где можно тренироваться составлять фразы на английском;
► Диалог — обсуждай темы из жизни, используя новую лексику. Закрепляй правила используя их в устной речи;
► Разговорный урок — практикуй разговорные навыки и понимание на слух, обсуждай актуальные темы на английском и обменивайся мнениями;
►Тест - проверь как ты усвоил материал, подведи итоги урока.

Мы используем:
Коммуникативную методику, комбинируя материалы Оксфорда и Кембриджа;
Ролевые и грамматические игры, дискуссионные топики;
Новейшие технологии и инновации, воплощенные в нашей онлайн платформе;
Харизму и неиссякаемую энергию преподавателей, чтобы вдохновить вас.


Цели и задачи обучения:
- приобрести базовый словарный запас;
- преодолеть языковый барьер;
- приобрести практические навыки базовой грамматики;
- расширить словарный запас;
- развить навык понимания на слух;
- улучшить произношение;
- научиться быстро формулировать мысли;
- улучшить фонетические навыки;
- обрести чувство языка;
- вникнуть в тонкости грамматики;
- научиться понимать неадаптированные тексты;
- получить максимум разговорной практики.

Приложение подходит для детей и взрослых от 6 лет.
